import React from "react";
import { Link, Route } from "react-router-dom";
import Header from "../Header";
import UserCard from "../UserCard";
import Wrapper from "../Wrapper";

function Home(props) {
    return (
        <Wrapper>
            <Header />
            <UserCard img = {"../public/images/Headshot002.jpeg"}
                name = {"Andres Agustin Ledesma"}
                jobTitle = {"Full-Stack Web Developer"}
                github = {"https://github.com/GhostsAg"} 
                />
            <Link to = {`${props.match.url}/about`} role = "button" className = "btn btn-link">
                About
            </Link>{" "}
            <Link to = {`${props.match.url}/portfolio`} role = "button" className = "btn btn-link">
                Portfolio
            </Link>
            <Link to= {`${props.match.url}/contact`} role = "button" className = "btn btn-link">
                Contact Me
            </Link>
            <Route exact path={`${props.match.url}/about`} component={About} />
            <Route exact path={`${props.match.url}/portfolio`} component={Portfolio} />
            <Route exact path={`${props.match.url}/contact`} component={Contact} />
        </Wrapper>
    );
}

export default Home;
